initPassTabBind=(()=>{document.querySelectorAll("[data-tab-jump-to]").forEach(function(e){var t=document.getElementById(e.dataset.tabJumpTo);e.addEventListener("keydown",function(n){if(9==n.keyCode&&!n.shiftKey){var o=n=>{t.focus(),e.removeEventListener("focusout",o)};e.addEventListener("focusout",o),t.tabIndex=0,t.blur()}}),t.addEventListener("keydown",function(n){if(9==n.keyCode&&n.shiftKey){cancelNext=!1;var o=n=>{e.focus(),t.removeEventListener("focusout",o)};t.addEventListener("focusout",o),e.tabIndex=0,e.blur()}})})}),document.addEventListener("DOMContentLoaded",e=>{initPassTabBind()});